(function(){jQuery(function(){return $("body").prepend('<div id="fb-root"></div>'),$.ajax({url:""+window.location.protocol+"//connect.facebook.net/en_US/all.js",dataType:"script",cache:!0})}),window.fbAsyncInit=function(){return FB.init({appId:'<%= ENV["FACEBOOK_APP_ID"] %>',cookie:!0}),$("#sign_in").click(function(e){return e.preventDefault(),FB.login(function(e){if(e.authResponse)return window.location="/auth/facebook/callback"})}),$("#sign_out").click(function(e){return FB.getLoginStatus(function(e){if(e.authResponse)return FB.logout()}),!0})}}).call(this);